feature["RP Crouch"] = menu.add_feature("RP Crouch", "value_str", localparents["Player Options"].id, function(f) -- Credits to noob9000 for most of this
	local Crouching = false
	while f.on do
		DISABLE_CONTROL_ACTION(0, 36, true)
		if controls.is_disabled_control_just_pressed(0, 36) and not Crouching and not player.is_player_in_any_vehicle(player.player_id()) then
			Crouching = true
			RESET_PED_MOVEMENT_CLIPSET(player.get_player_ped(player.player_id()), 0.0)
			DISABLE_AIM_CAM_THIS_UPDATE()
			SET_PED_CAN_PLAY_AMBIENT_ANIMS(player.get_player_ped(player.player_id()), false)
			SET_PED_CAN_PLAY_AMBIENT_BASE_ANIMS(player.get_player_ped(player.player_id()), false)
			SET_THIRD_PERSON_AIM_CAM_NEAR_CLIP_THIS_UPDATE(-10.0)
			streaming.request_anim_set("move_ped_crouched")
			SET_PED_MOVEMENT_CLIPSET(player.get_player_ped(player.player_id()), "move_ped_crouched", (f.value == 0 and 1.0) or (f.value == 1 and 0.0))
			streaming.request_anim_set("move_ped_crouched_strafing")
			SET_PED_STRAFE_CLIPSET(player.get_player_ped(player.player_id()), "move_ped_crouched_strafing")
		elseif controls.is_disabled_control_just_pressed(0, 36) and Crouching and not player.is_player_in_any_vehicle(player.player_id()) then
			Crouching = false
			SET_PED_CAN_PLAY_AMBIENT_ANIMS(player.get_player_ped(player.player_id()), true)
			SET_PED_CAN_PLAY_AMBIENT_BASE_ANIMS(player.get_player_ped(player.player_id()), true)
			streaming.remove_anim_set("move_ped_crouched")
			streaming.remove_anim_set("move_ped_crouched_strafing")
			RESET_PED_MOVEMENT_CLIPSET(player.get_player_ped(player.player_id()), (f.value == 0 and 0.5) or (f.value == 1 and 0.0))
			RESET_PED_STRAFE_CLIPSET(player.get_player_ped(player.player_id()))
		end
		system.yield(0)
	end
	SET_PED_CAN_PLAY_AMBIENT_ANIMS(player.get_player_ped(player.player_id()), true)
	SET_PED_CAN_PLAY_AMBIENT_BASE_ANIMS(player.get_player_ped(player.player_id()), true)
	streaming.remove_anim_set("move_ped_crouched")
	streaming.remove_anim_set("move_ped_crouched_strafing")
	RESET_PED_MOVEMENT_CLIPSET(player.get_player_ped(player.player_id()), (f.value == 0 and 0.5) or (f.value == 1 and 0.0))
	RESET_PED_STRAFE_CLIPSET(player.get_player_ped(player.player_id()))
	ENABLE_CONTROL_ACTION(0, 36, true)
end)
feature["RP Crouch"]:set_str_data({"Normal", "Fast"})

