menu.add_feature("Enable Freecam", "toggle", localparents["Freecam"].id, function(f)
	if f.on then
		freecam_player_cam = CREATE_CAM_WITH_PARAMS("DEFAULT_SCRIPTED_CAMERA", player.get_player_coords(player.player_id()).x, player.get_player_coords(player.player_id()).y, player.get_player_coords(player.player_id()).z + 2.0, cam.get_gameplay_cam_rot().x, cam.get_gameplay_cam_rot().y, cam.get_gameplay_cam_rot().z, 70.0, false, false)
		SET_CAM_ACTIVE(freecam_player_cam, true)
		RENDER_SCRIPT_CAMS(true, true, 1000, true, true, 0)
		while f.on do
			system.yield(0)
			DISABLE_ALL_CONTROL_ACTIONS(0)
			for i = 0, 6 do
				ENABLE_CONTROL_ACTION(0, i, true)
			end
			for i = 199, 202 do
				ENABLE_CONTROL_ACTION(0, i, true)
			end
			for i = 14, 15 do
				ENABLE_CONTROL_ACTION(0, i, true)
			end
			ENABLE_CONTROL_ACTION(0, 177, true)
			ENABLE_CONTROL_ACTION(0, 237, true)
			ENABLE_CONTROL_ACTION(0, 20, true)
			ENABLE_CONTROL_ACTION(0, 246, true)
			ENABLE_CONTROL_ACTION(0, 245, true)
			if player.is_player_in_any_vehicle(player.player_id()) then
				REQUEST_ADDITIONAL_COLLISION_AT_COORD(entity.get_entity_coords(player.get_player_vehicle(player.player_id())))
			end
			REQUEST_ADDITIONAL_COLLISION_AT_COORD(player.get_player_coords(player.player_id()))
			SET_CAM_ROT(freecam_player_cam, cam.get_gameplay_cam_rot().x, cam.get_gameplay_cam_rot().y, cam.get_gameplay_cam_rot().z, 2)
			if feature["Freecam Hide HUD"].on then
				ui.hide_hud_and_radar_this_frame()
			end
			if feature["Draw Line"].on then
				ui.draw_line(GET_CAM_COORD(freecam_player_cam) - v3(0, 0, 1), player.get_player_coords(player.player_id()), 255, 25, 25, 175)
			end
			if controls.is_disabled_control_pressed(0, 32) then
				local dir = GET_CAM_ROT(freecam_player_cam, 2)
				dir:transformRotToDir()
				SET_CAM_COORD(freecam_player_cam, (GET_CAM_COORD(freecam_player_cam) + dir * feature["Freecam Speed"].value).x, (GET_CAM_COORD(freecam_player_cam) + dir * feature["Freecam Speed"].value).y, (GET_CAM_COORD(freecam_player_cam) + dir * feature["Freecam Speed"].value).z)
			end
			if controls.is_disabled_control_pressed(0, 35) then
				local dir = GET_CAM_ROT(freecam_player_cam, 2) - v3(0, 0, 90)
				dir:transformRotToDir()
				SET_CAM_COORD(freecam_player_cam, (GET_CAM_COORD(freecam_player_cam) + dir * feature["Freecam Speed"].value).x, (GET_CAM_COORD(freecam_player_cam) + dir * feature["Freecam Speed"].value).y, (GET_CAM_COORD(freecam_player_cam) + dir * feature["Freecam Speed"].value).z)
			end
			if controls.is_disabled_control_pressed(0, 34) then
				local dir = GET_CAM_ROT(freecam_player_cam, 2) + v3(0, 0, 90)
				dir:transformRotToDir()
				SET_CAM_COORD(freecam_player_cam, (GET_CAM_COORD(freecam_player_cam) + dir * feature["Freecam Speed"].value).x, (GET_CAM_COORD(freecam_player_cam) + dir * feature["Freecam Speed"].value).y, (GET_CAM_COORD(freecam_player_cam) + dir * feature["Freecam Speed"].value).z)
			end
			if controls.is_disabled_control_pressed(0, 33) then
				local dir = GET_CAM_ROT(freecam_player_cam, 2)
				dir:transformRotToDir()
				SET_CAM_COORD(freecam_player_cam, (GET_CAM_COORD(freecam_player_cam) - dir * feature["Freecam Speed"].value).x, (GET_CAM_COORD(freecam_player_cam) - dir * feature["Freecam Speed"].value).y, (GET_CAM_COORD(freecam_player_cam) - dir * feature["Freecam Speed"].value).z)
			end
			if controls.is_disabled_control_pressed(0, 21) then
				SET_CAM_COORD(freecam_player_cam, (GET_CAM_COORD(freecam_player_cam) + v3(0, 0, 1 * feature["Freecam Speed"].value)).x, (GET_CAM_COORD(freecam_player_cam) + v3(0, 0, 1 * feature["Freecam Speed"].value)).y, (GET_CAM_COORD(freecam_player_cam) + v3(0, 0, 1 * feature["Freecam Speed"].value)).z)
			end
			if controls.is_disabled_control_pressed(0, 36) then
				SET_CAM_COORD(freecam_player_cam, (GET_CAM_COORD(freecam_player_cam) - v3(0, 0, 1 * feature["Freecam Speed"].value)).x, (GET_CAM_COORD(freecam_player_cam) - v3(0, 0, 1 * feature["Freecam Speed"].value)).y, (GET_CAM_COORD(freecam_player_cam) - v3(0, 0, 1 * feature["Freecam Speed"].value)).z)
			end
			SET_FOCUS_POS_AND_VEL(GET_CAM_COORD(freecam_player_cam), 0.0, 0.0, 0.0)
			LOCK_MINIMAP_POSITION(GET_CAM_COORD(freecam_player_cam).x, GET_CAM_COORD(freecam_player_cam).y)
		end
	end
	if not f.on then
		if freecam_player_cam then
			DESTROY_CAM(freecam_player_cam, false)
			RENDER_SCRIPT_CAMS(false, false, 0, true, true, 0)
			freecam_player_cam = nil
		end
		UNLOCK_MINIMAP_POSITION()
		ENABLE_ALL_CONTROL_ACTIONS(0)
		CLEAR_FOCUS()
	end
end)

