feature["Enable Session Info Window"] = menu.add_feature("Enable", "toggle", localparents["Session Info Window"].id, function(f)
	local sprite2
	if utils.file_exists(utils.get_appdata_path(Paths.AddictScript.Data, "sprite2.png")) then
		sprite2 = scriptdraw.register_sprite(utils.get_appdata_path(Paths.AddictScript.Data, "sprite2.png"))
	end
	while f.on do
		system.yield(0)
		local current_host = player.get_player_name(player.get_host())
		if player.get_host() == -1 then
			current_host = "-"
		end
		local next_host = player.get_player_name(player.get_host())
		if player.get_host() ~= -1 and get_player_from_host_priority(1) == player.get_host() and get_player_from_host_priority(2) ~= nil then
			next_host = player.get_player_name(get_player_from_host_priority(2))
		elseif player.get_host() ~= -1 and get_player_from_host_priority(1) ~= player.get_host() and get_player_from_host_priority(1) ~= nil then
			next_host = player.get_player_name(get_player_from_host_priority(1))
		else
			next_host = "-"
		end
		local current_script_host = player.get_player_name(script.get_host_of_this_script())
		if script.get_host_of_this_script() == -1 then
			current_script_host = "-"
		end
		local next_script_host = player.get_player_name(player.get_host())
		if network.is_session_started() and get_next_script_host() ~= -1 and get_next_script_host() ~= script.get_host_of_this_script() and get_next_script_host() ~= nil then
			next_script_host = player.get_player_name(get_next_script_host())
		else
			next_script_host = "-"
		end
		local modders = 0
		for pid = 0, 31 do
			if player.is_player_valid(pid) and player.is_player_modder(pid, -1) then
				modders = modders + 1
