		scriptdraw.draw_text("Session Host: " .. tostring(current_host) .. "\n\nNext Host: " .. tostring(next_host) .. "\n\nScript Host: " .. tostring(current_script_host) .. "\n\nNext Script Host: " .. tostring(next_script_host) .. "\n\nType: " .. tostring(get_session_type()) .. "\n\nHidden: " .. tostring(not NETWORK_SESSION_IS_VISIBLE()) .. "\n\nPlayer Count: " .. tostring(player.player_count()) .. "\n\nModder Count: " .. tostring(modders) .. "\n\nFriend Count: " .. tostring(friends), v2(feature["Session Info Window X Position"].value / 100 - feature["Session Info Window Background Size"].value / 8 + feature["Session Info Window Text Offset"].value / 1000, feature["Session Info Window Y Position"].value / 100 - feature["Session Info Window Background Size"].value * -0.25), v2(feature["Session Info Window Text Size"].value, feature["Session Info Window Text Size"].value), feature["Session Info Window Text Size"].value, rgba_to_uint32_t(feature["Session Info Window Text R"].value, feature["Session Info Window Text G"].value, feature["Session Info Window Text B"].value, feature["Session Info Window Text A"].value), 1 << 1, math.tointeger(feature["Session Info Window Text Font"].value))
		local line_offset = 0.0
