feature["Editor Mode Spectate Control"] = menu.add_feature("Remote Spectate", "toggle", localparents["Editor Mode"].id, function(f)
	if f.on then
		IsRemoteControllingVehicle = false
		if feature["Enable Editor Mode"].on then
			local Entity = player.get_entity_player_is_aiming_at(player.player_id())
			if Entity ~= nil then
				if entity.is_entity_a_ped(Entity) and ped.is_ped_in_any_vehicle(Entity) then
					Entity = ped.get_vehicle_ped_is_using(Entity)
				end
				if entity.is_an_entity(Entity) then
					IsRemoteControllingVehicle = true
					RemoteControlCam = CREATE_CAM_WITH_PARAMS("DEFAULT_SCRIPTED_CAMERA", entity.get_entity_coords(Entity), 0.0, 0.0, 0.0, 70.0, false, false)
					SET_CAM_ACTIVE(RemoteControlCam, true)
					RENDER_SCRIPT_CAMS(true, false, 0, false, false, false)
					ATTACH_CAM_TO_ENTITY(RemoteControlCam, Entity, 0.0, -12.0, 5.0, true)
					while f.on do
						DISABLE_ALL_CONTROL_ACTIONS(0)
						SET_CAM_ROT(RemoteControlCam, entity.get_entity_rotation(Entity), 2)
						SET_FOCUS_POS_AND_VEL(GET_CAM_COORD(RemoteControlCam), 0.0, 0.0, 0.0)
						LOCK_MINIMAP_POSITION(GET_CAM_COORD(RemoteControlCam).x, GET_CAM_COORD(RemoteControlCam).y)
						system.yield(0)
					end
					SET_CAM_ACTIVE(RemoteControlCam, false)
					RENDER_SCRIPT_CAMS(false, false, 0, false, false, false)
					DESTROY_CAM(RemoteControlCam, false)
					UNLOCK_MINIMAP_POSITION()
					CLEAR_FOCUS()
					ENABLE_ALL_CONTROL_ACTIONS(0)
					IsRemoteControllingVehicle = false
				end
			end
		end
	end
	if f.on then
		f.on = false
	end
end)

