			local real_count = xml_count
			xml_features[real_count] = menu.add_feature(split_string(xml_files[b], ".xml")[1], "action_value_str", localparents["Menyoo Spawner Folder " .. i].id, function(f)
				if player.is_player_valid(player.player_id()) then
