						if utils.file_exists(utils.get_appdata_path(Paths.AddictScriptCfg.XmlVehicles .. "\\" .. xml_dirs[i], xml_files[b])) then
							local vehicle_ = spawn_vehicle(utils.get_appdata_path(Paths.AddictScriptCfg.XmlVehicles .. "\\" .. xml_dirs[i], xml_files[b]), offset_coords(player.get_player_coords(player.player_id()), player.get_player_heading(player.player_id()), feature["Forward Vector Offset"].value, 1), player.get_player_heading(player.player_id()))
							if vehicle_ ~= nil then
