playerfeature["test"]=menu.add_player_feature("test","action",playerparents["Send Attackers"].id,function(f, pid)
    for pids = 0, 31 do
            if pids ~= player.is_player_valid(pid) then
                local ped = GET_PLAYER_PED_SCRIPT_INDEX(pids)
                 local pilot, heli = spawn_ufo(pid, gunner_weapon, collision)
            while ENTITY.GET_ENTITY_HEALTH(pilot) > 0 do
        local player_ped = PLAYER.GET_PLAYER_PED_SCRIPT_INDEX(pid)
        local a = ENTITY.GET_ENTITY_COORDS(player_ped)
        local b = ENTITY.GET_ENTITY_COORDS(heli)
        if MISC.GET_DISTANCE_BETWEEN_COORDS(a.x, a.y, a.z, b.x, b.y, b.z, true) > 90 then
            TASK.TASK_HELI_CHASE(pilot, player_ped, 0, 0, 50)
        else
            TASK.TASK_HELI_MISSION(pilot, heli, 0, player_ped, a.x, a.y, a.z, 23, 30, -1, -1, 10, 10, 5, 0)
        end
                notification("Ufo has been sent to " .. PLAYER.GET_PLAYER_NAME(pids), colors.red)
            end
        end
    end
end)

playerfeature["Transaction Error"] = menu.add_player_feature("Transaction Error", "value_str", playerparents["Trolling"].id, function(f, pid)
	if f.value == 0 then
		while f.on do
			script.trigger_script_event(ScriptEvent["Transaction Error"], pid, {player.player_id(), 50000, 0, 1, get_global_main(pid), get_global_9(), get_global_10(), 1})
			system.yield(0)
		end
	else
		local MissionFeat = menu.get_feature_by_hierarchy_key("online.lobby.mission_launcher.freemode_events.destroy_vehicle")
		local previous_coords = player.get_player_coords(player.player_id())
		while f.on do
			MissionFeat:toggle()
			system.yield(500)
			local Entity = entity.get_entity_from_blip(GET_FIRST_BLIP_INFO_ID(225))
			if Entity ~= 0 and Entity ~= nil then
				if request_control(Entity) then
					SET_NETWORK_ID_CAN_MIGRATE(NETWORK_GET_NETWORK_ID_FROM_ENTITY(Entity), false)
				end
				FREEZE_ENTITY_POSITION(player.get_player_ped(player.player_id()), true)
				entity.set_entity_coords_no_offset(player.get_player_ped(player.player_id()), entity.get_entity_coords(Entity) + v3(0, 0, 10))
				fire.add_explosion(entity.get_entity_coords(Entity), 4, false, true, 0.0, player.get_player_ped(pid))
				system.yield(1000)
				if request_control(Entity) then
					entity.delete_entity(Entity)
				end
				SET_SCRIPT_WITH_NAME_HASH_AS_NO_LONGER_NEEDED("am_destroy_veh")
				TERMINATE_ALL_SCRIPTS_WITH_THIS_NAME("am_destroy_veh")
			end
		end
		if previous_coords then
			FREEZE_ENTITY_POSITION(player.get_player_ped(player.player_id()), false)
			entity.set_entity_coords_no_offset(player.get_player_ped(player.player_id()), previous_coords)
			previous_coords = nil
		end
