					system.yield(8000)
					local mugger = nil
					local time = utils.time_ms() + 6000
					while time > utils.time_ms() and mugger == nil do
						local peds = ped.get_all_peds()
						for i = 1, #peds do
							if not ped.is_ped_a_player(peds[i]) and (GET_ENTITY_SCRIPT(peds[i], 0) == "AM_GANG_CALL" or GET_ENTITY_SCRIPT(peds[i], 0) == "am_gang_call") and ped.get_current_ped_weapon(peds[i]) == gameplay.get_hash_key("weapon_knife") and not is_script_entity(peds[i]) then
