				ped.set_ped_health(peds[i], 0)
			end
		elseif get_distance_between(peds[i], Position) > 200 and get_distance_between(peds[i], Position) < 400 and player.get_player_from_ped(peds[i]) ~= player.player_id() then
			network.request_control_of_entity(peds[i])
			fire.add_explosion(entity.get_entity_coords(peds[i]), 3, true, false, 0.1, Owner)
			ped.set_ped_to_ragdoll(peds[i], 1000, 1000, 0)
			entity.set_entity_velocity(peds[i], (entity.get_entity_coords(peds[i]) - Position) * (40 / get_distance_between(peds[i], Position)))
			if not ped.is_ped_a_player(peds[i]) then
				ped.set_ped_health(peds[i], 0)
			end
		end
	end
	local found_index = false
	local found_train = nil
	local vehicles = vehicle.get_all_vehicles()
	for i = 1, #vehicles do
		if get_distance_between(vehicles[i], Position) < 400 then
			network.request_control_of_entity(vehicles[i])
			SET_VEHICLE_PETROL_TANK_HEALTH(vehicles[i], -999.90002441406)
			entity.set_entity_velocity(vehicles[i], (entity.get_entity_coords(vehicles[i]) - Position) * (100 / get_distance_between(vehicles[i], Position)))
		elseif get_distance_between(vehicles[i], Position) > 200 and get_distance_between(vehicles[i], Position) < 400 then
			network.request_control_of_entity(vehicles[i])
			vehicle.set_vehicle_engine_health(vehicles[i], -4000)
			entity.set_entity_velocity(vehicles[i], (entity.get_entity_coords(vehicles[i]) - Position) * (40 / get_distance_between(vehicles[i], Position)))
		end
		if entity.get_entity_model_hash(vehicles[i]) == 1030400667 then
			if not found_index then
				found_train = vehicles[i]
			end
			found_index = true
		end
	end
	if found_index and found_train ~= nil then
		SET_TRAIN_SPEED(found_train, 0.0)
		SET_TRAIN_CRUISE_SPEED(found_train, 0.0)
		SET_RENDER_TRAIN_AS_DERAILED(found_train, true)
	end
end

function get_richest_ped()
	local peds = ped.get_all_peds()
	if #peds > 1 then
		table.sort(peds, function(a, b)
			return (GET_PED_MONEY(a) > GET_PED_MONEY(b))
		end)
		return peds[1]
	elseif #peds == 1 then
		return peds[1]
	else
		return nil
	end
end

