function get_player_name(pid, mode)
	local Name = "**Invalid**"
	if player.is_player_valid(pid) then
		if mode == 1 then
			Name = player.get_player_name(pid)
		elseif mode == 2 then
			Name = GET_PLAYER_NAME(pid)
		elseif mode == 3 then
			Name = NETWORK_PLAYER_GET_NAME(pid)
		else
			local Buffer = NETWORK_HANDLE_FROM_PLAYER(pid, 13)
			local Start = NETWORK_GAMERTAG_FROM_HANDLE_START(Buffer)
			if Start then
				local GetName = NETWORK_GET_GAMERTAG_FROM_HANDLE(Buffer)
				local End = NETWORK_GAMERTAG_FROM_HANDLE_SUCCEEDED()
				if End then
					Name = GetName
				end
			end
		end
	end
	return Name
end

AddictScriptIsPlayerTimeout = {}

function timeout_player(pid, time)
	if player.is_player_valid(pid) then
		local block_parent = menu.get_feature_by_hierarchy_key("online.online_players.player_" .. pid .. ".block")
		if block_parent ~= nil then
			menu.create_thread(function()
				AddictScriptIsPlayerTimeout[pid] = true
				local block_children = block_parent.children
				local enabled = {}
				for i = 2, #block_children do
					enabled[i] = block_children[i].on
					block_children[i].on = true
				end
				system.yield(time)
				for i = 2, #block_children do
					block_children[i].on = enabled[i]
				end
				AddictScriptIsPlayerTimeout[pid] = false
			end, nil)
		end
	end
end

