		end
	end
	table.sort(player_table, function(a, b)
		return (get_distance_between(a, coords) < get_distance_between(b, coords))
	end)
	if #player_table == 0 then
		return player.player_id()
	else
		return player.get_player_from_ped(player_table[1])
	end
end


