function any_to_pointer(Handle)
	if Handle then
		if entity.is_an_entity(Handle) then
			return get_any(Handle)
		end
	end
	return 0
end

function handle_to_pointer(Handle)
	if Handle then
		if entity.is_an_entity(Handle) then
			if entity.is_entity_a_ped(Handle) then
				return get_ped(Handle)
			elseif entity.is_entity_a_vehicle(Handle) then
				return get_vehicle(Handle)
			elseif entity.is_entity_an_object(Handle) then
				return get_object(Handle)
			else
				return get_any(Handle)
			end
		end
	end
	return 0
end

function pointer_to_handle(Pointer)
	if Pointer then
		return get_entity(Pointer)
	end
	return 0
end

