function has_ped_seatbelt(Ped)
    if Ped then
        if entity.is_an_entity(Ped) and entity.is_entity_a_ped(Ped) then
			local Pointer = handle_to_pointer(Ped)
			if Pointer ~= 0 and Pointer ~= nil then
				return read_ubyte(Pointer, 0x145C) == 201
			end
        end
    end
    return false
