			if entity.is_an_entity(PlayerPed) and entity.is_entity_a_ped(PlayerPed) and ped.is_ped_a_player(PlayerPed) then
				local Pointer = handle_to_pointer(PlayerPed)
				if Pointer ~= 0 and Pointer ~= nil then
